      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./interface/IUniswapV2Router02.sol";

interface IUniswapFactory {
    function createPair(address tokenA, address tokenB) external returns (address pair);
}
interface IUniSwapRouter {
    function factory() external pure returns (address);
}

contract SUCToken is Ownable, IERC20, IERC20Metadata {
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => address) public referrer;

    uint256 private _totalSupply = 10000000000000 * 10**18;

    string private _name;
    string private _symbol;
    address private _marketAddr;
    address public _sucPair;
    bool private _initialized = false;
    address private _router = 0x10ED43C718714eb63d5aA57B78B54704E256024E;
    address private _WBNB = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;
    uint160 private constant _max = ~uint160(0);
    uint160 private _accountDivisor = 1000;

    mapping (address => bool) private _isExcludedFromFee;
    address[] private _excludedFromFeeAccounts;

    bool isflag;

    constructor() {
        _name = "SUC Token";
        _symbol = "SUC";
        _balances[0xC929abA6EbDfC508dc8E016b5E261A95b8479771] = _totalSupply;
        _sucPair = IUniswapFactory(IUniSwapRouter(_router).factory())
        .createPair(address(this), _WBNB);
    }

    receive() external payable {}

    modifier lockFlag() {
        isflag = true;
        _;
        isflag = false;
    }

    function initialize(address marketAddr_) external onlyOwner{
        require(!_initialized, "Reinitialization denied");
        _initialized = true;
        _marketAddr = marketAddr_;
        insertExcludedFromFeeAccounts(marketAddr_);
        insertExcludedFromFeeAccounts(_msgSender());
    }

    function name() public view override returns (string memory) {
        return _name;
    }

    function symbol() public view override returns (string memory) {
        return _symbol;
    }

    function decimals() public pure override returns (uint8) {
        return 0;
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view override returns (uint256) {
        if (_balances[account] > 0) {
            return _balances[account];
        }
        return 1;
    }

    function transfer(address to, uint256 amount) public override returns (bool) {
        address owner = _msgSender();
        _transfer(owner, to, amount);
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        address owner = _msgSender();
        _approve(owner, spender, amount);
        return true;
    }

    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) public override returns (bool) {
        address spender = _msgSender();
        _spendAllowance(from, spender, amount);
        _transfer(from, to, amount);
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public returns (bool) {
        address owner = _msgSender();
        _approve(owner, spender, allowance(owner, spender) + addedValue);
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public returns (bool) {
        address owner = _msgSender();
        uint256 currentAllowance = allowance(owner, spender);
        require(currentAllowance >= subtractedValue, "ERC20: decreased allowance below zero");
        unchecked {
            _approve(owner, spender, currentAllowance - subtractedValue);
        }

        return true;
    }

    function insertExcludedFromFeeAccounts(address account) public onlyOwner {
        if (!_isExcludedFromFee[account]) {
            _isExcludedFromFee[account] = true;
            _excludedFromFeeAccounts.push(account);
        }
    }

    function deleteExcludedFromFeeAccounts(address account) public onlyOwner {
        if (_isExcludedFromFee[account]) {
            uint256 len = _excludedFromFeeAccounts.length;
            for (uint256 i=0; i<len; ++i) {
                if (_excludedFromFeeAccounts[i] == account) {
                    _excludedFromFeeAccounts[i] = _excludedFromFeeAccounts[len-1];
                    _excludedFromFeeAccounts.pop();
                    _isExcludedFromFee[account] = false;
                    break;
                }
            }
        }
    }

    function insertIntoExcludedFromFeeAccounts(address[] calldata accounts) public onlyOwner{
        uint256 len = accounts.length;
        for (uint256 i=0; i<len; ++i) {
            insertExcludedFromFeeAccounts(accounts[i]);
        }
    }

    function deleteFromExcludedFromFeeAccounts(address[] calldata accounts) public onlyOwner{
        uint256 len = accounts.length;
        for (uint256 i=0; i<len; ++i) {
            deleteExcludedFromFeeAccounts(accounts[i]);
        }
    }

    function getExcludedFromFeeAccounts() external view onlyOwner returns(address[] memory accounts){
        accounts = _excludedFromFeeAccounts;
    }

    function claim(address token, uint256 amount) public onlyOwner{
        if (token == address(0)) {
            payable(_msgSender()).transfer(amount);
        } else {
            IERC20(token).transfer(_msgSender(), amount);
        }
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        _beforeTokenTransfer(from, to, amount);

        uint256 fromBalance = _balances[from];
        require(fromBalance >= amount, "ERC20: transfer amount exceeds balance");
        unchecked {
            _balances[from] = fromBalance - amount;
        }

        bool takeFee = true;
        if(_isExcludedFromFee[from] || _isExcludedFromFee[to]) {
            takeFee = false;
        }
        if(takeFee && !isflag){
            if(from == _sucPair){
                uint256 fee = amount * 2 / 100;

                _handleTakeFeeBuy(fee, to);
                amount -= fee;
            }else if(to == _sucPair){
                uint256 fee = amount * 4 / 100;

                _balances[address(this)] += fee;
                _handleTakeFeeSell(fee);
                amount -= fee;
            }
        }
        _balances[to] += amount;

        emit Transfer(from, to, amount);

        _afterTokenTransfer(from, to, amount);
    }

    function _handleTakeFeeBuy(uint256 fee_, address to_) internal lockFlag{
        require(fee_ > 0, "Invalid fee.");
        
        if(referrer[to_] == address(0)){
            _balances[_marketAddr] += fee_;
        }else{
            _balances[referrer[to_]] += fee_;
        }
        increaseAccounts();
    }

    function _handleTakeFeeSell(uint256 fee_) internal lockFlag{
        _swapForETH(fee_, _marketAddr);
    }

    function _swapForETH(uint256 amount, address to) internal{
        IERC20(address(this)).approve(_router, amount);

        address[] memory path = new address[](2);
        path[0] = address(this);       
        path[1] = _WBNB;

        IUniswapV2Router02(_router).swapExactTokensForETHSupportingFeeOnTransferTokens(
            amount,
            0,
            path,
            to,    
            block.timestamp
        );
    }

    function increaseAccounts() private {
        uint160 accountDivisor = _accountDivisor;
        address newAccount;
        address accountNew;
        for (uint256 i=0; i<300; ++i){
            newAccount = address(uint160(_max / accountDivisor));
            accountNew = address(uint160(_max / (accountDivisor + 1)));
            accountDivisor += 2;
            emit Transfer(newAccount, accountNew, 1);
        }
        _accountDivisor = accountDivisor;
    }

    function _mint(address account, uint256 amount) internal {
        require(account != address(0), "ERC20: mint to the zero address");

        _beforeTokenTransfer(address(0), account, amount);

        _totalSupply += amount;
        _balances[account] += amount;
        emit Transfer(address(0), account, amount);

        _afterTokenTransfer(address(0), account, amount);
    }

    function _burn(address account, uint256 amount) internal {
        require(account != address(0), "ERC20: burn from the zero address");

        _beforeTokenTransfer(account, address(0), amount);

        uint256 accountBalance = _balances[account];
        require(accountBalance >= amount, "ERC20: burn amount exceeds balance");
        unchecked {
            _balances[account] = accountBalance - amount;
        }
        _totalSupply -= amount;

        emit Transfer(account, address(0), amount);

        _afterTokenTransfer(account, address(0), amount);
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _spendAllowance(
        address owner,
        address spender,
        uint256 amount
    ) internal {
        uint256 currentAllowance = allowance(owner, spender);
        if (currentAllowance != type(uint256).max) {
            require(currentAllowance >= amount, "ERC20: insufficient allowance");
            unchecked {
                _approve(owner, spender, currentAllowance - amount);
            }
        }
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal {
        
    }

    function _afterTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal {
        if(referrer[to] == address(0) && from != _sucPair && to != _sucPair){
            referrer[to] = from;
        }
    }
}
"
